
(function(){ 
  const FILM_SPECS = {"DR Night View Ceramic 05": {"VLT": 7, "TSER": 82, "Luminous": 0.35, "SC": 0.2, "SHGC": 0.18, "TST": 7, "TSR": 54, "TSA": 39, "VLR_Int": 14, "VLR_Ext": 65, "UV": 99, "Glare": 92, "U": 0.92, "Emiss": 0.71}, "DR Night View Ceramic 15": {"VLT": 15, "TSER": 75, "Luminous": 0.52, "SC": 0.29, "SHGC": 0.25, "TST": 13, "TSR": 44, "TSA": 43, "VLR_Int": 21, "VLR_Ext": 47, "UV": 99, "Glare": 84, "U": 0.94, "Emiss": 0.75}, "DR Night View Ceramic 25": {"VLT": 23, "TSER": 69, "Luminous": 0.64, "SC": 0.36, "SHGC": 0.31, "TST": 19, "TSR": 36, "TSA": 45, "VLR_Int": 17, "VLR_Ext": 40, "UV": 99, "Glare": 74, "U": 0.96, "Emiss": 0.77}, "DR Night View Ceramic 35": {"VLT": 35, "TSER": 58, "Luminous": 0.73, "SC": 0.48, "SHGC": 0.41, "TST": 29, "TSR": 24, "TSA": 47, "VLR_Int": 14, "VLR_Ext": 25, "UV": 99, "Glare": 61, "U": 0.98, "Emiss": 0.81}, "DR Night View Ceramic 45": {"VLT": 45, "TSER": 51, "Luminous": 0.79, "SC": 0.57, "SHGC": 0.48, "TST": 36, "TSR": 14, "TSA": 50, "VLR_Int": 13, "VLR_Ext": 15, "UV": 99, "Glare": 51, "U": 0.99, "Emiss": 0.83}};
  const SPEC_IMG = {"DR Night View Ceramic 05": "data:image/jpeg;base64,", "DR Night View Ceramic 15": "data:image/jpeg;base64,", "DR Night View Ceramic 25": "data:image/jpeg;base64,", "DR Night View Ceramic 35": "data:image/jpeg;base64,", "DR Night View Ceramic 45": "data:image/jpeg;base64,"};
  const $ = (id) => document.getElementById(id);
  const money0 = (n) => n.toLocaleString(undefined, { style:'currency', currency:'USD', maximumFractionDigits:0 });
  const clamp = (n,min,max)=>Math.min(Math.max(Number(n)||0,min),max);

  const elFilm = $("filmChoice");
  Object.keys(FILM_SPECS).forEach(k=>{ const o=document.createElement('option'); o.value=k; o.textContent=k; elFilm.appendChild(o); });
  elFilm.value = Object.keys(FILM_SPECS)[2];
  function filmSummary(name){ const s=FILM_SPECS[name]; return `VLT ${s.VLT}%, TSER ${s.TSER}%, SHGC ${s.SHGC}, UV >${s.UV}%, Glare  ${s.Glare}%`; }
  $("filmSummary").textContent = filmSummary(elFilm.value);
  elFilm.addEventListener('change', ()=>$("filmSummary").textContent = filmSummary(elFilm.value));

  let S = { buildingSqft:+$("buildingSqft").value, ratePerSf:+$("ratePerSf").value, modeHVAC:'perSf', hvacPerSfYr:+$("hvacPerSfYr").value, annualHvacCustom:+$("annualHvacCustom").value, modeGlass:'ratio', glassRatio:+$("glassRatio").value, glassSqftCustom:+$("glassSqftCustom").value, utilityRate:+$("utilityRate").value, cdd:+$("cdd").value };

  function compute(){ 
    const glass = S.modeGlass==='custom' && S.glassSqftCustom>0 ? S.glassSqftCustom : Math.round(S.buildingSqft*S.glassRatio);
    const cost = glass * S.ratePerSf;
    const hvac = S.modeHVAC==='custom' ? S.annualHvacCustom : S.buildingSqft*S.hvacPerSfYr;
    const spec = FILM_SPECS[elFilm.value];
    const basePct = Math.min(0.6, Math.max(0.05, (spec.TSER/100)*0.45 + (1-spec.SHGC)*0.10));
    const rateAdj = (S.utilityRate||0.12)/0.12;
    const cddAdj = (S.cdd||2500)/2500;
    const savings = hvac * basePct * rateAdj * cddAdj;
    const pay = savings>0 ? (cost/savings) : 0;
    const net = savings*5 - cost;
    $("kpiGlass").textContent = glass.toLocaleString() + " sf";
    $("kpiCost").textContent = money0(cost);
    $("kpiSave").textContent = money0(savings);
    $("kpiPay").textContent = (savings>0?pay.toFixed(1):'') + " yrs";
    $("kpiNet").textContent = money0(net);
    $("printContent").innerHTML = `
      <div><b>Client:</b> ${$("clientName").value||''} &nbsp; <b>Site:</b> ${$("clientAddr").value||''}</div>
      <div style='margin-top:6px'><b>Film:</b> ${elFilm.value}  Specs in attached sheet</div>
      <div class='divider' style='height:1px;background:#e5e7eb;margin:8px 0;'></div>
      <table style='width:100%;border-collapse:collapse;font-size:12px'>
        <tr><th style='text-align:left;border-bottom:1px solid #e5e7eb;padding:6px 0'>Metric</th><th style='text-align:left;border-bottom:1px solid #e5e7eb;padding:6px 0'>Value</th><th style='text-align:left;border-bottom:1px solid #e5e7eb;padding:6px 0'>Benefit</th></tr>
        <tr><td>Estimated glass area</td><td>${glass.toLocaleString()} sf</td><td>Scope baseline</td></tr>
        <tr><td>Installed cost</td><td>${money0(cost)}</td><td>Turnkey at $${S.ratePerSf.toFixed(2)}/sf</td></tr>
        <tr><td>Annual HVAC spend</td><td>${money0(hvac)}</td><td>Baseline per inputs</td></tr>
        <tr><td>Expected annual savings</td><td>${money0(savings)}</td><td>Adjusted by utility rate + CDD</td></tr>
        <tr><td>Simple payback</td><td>${savings>0?pay.toFixed(1):''} years</td><td>Cashoncash recovery</td></tr>
        <tr><td>5year net</td><td>${money0(net)}</td><td>After capex</td></tr>
      </table>`;
  }

  function bind(){ 
    function upd(){ 
      S.buildingSqft=clamp($("buildingSqft").value,1500,50000);
      S.ratePerSf=Math.max(0,+$("ratePerSf").value||0);
      S.modeHVAC=document.querySelector('input[name="modeHVAC"]:checked').value;
      $("hvacPerSfYr").style.display=S.modeHVAC==='perSf'?'block':'none';
      $("annualHvacCustom").style.display=S.modeHVAC==='custom'?'block':'none';
      S.hvacPerSfYr=+$("hvacPerSfYr").value||0; S.annualHvacCustom=+$("annualHvacCustom").value||0;
      S.modeGlass=document.querySelector('input[name="modeGlass"]:checked').value;
      $("glassRatio").style.display=S.modeGlass==='ratio'?'block':'none';
      $("glassSqftCustom").style.display=S.modeGlass==='custom'?'block':'none';
      S.glassRatio=clamp($("glassRatio").value,0.05,0.6);
      S.glassSqftCustom=+$("glassSqftCustom").value||0;
      S.utilityRate=+$("utilityRate").value||0.12;
      S.cdd=+$("cdd").value||2500;
      compute();
    }
    document.querySelectorAll('input,select').forEach(el=>el.addEventListener('input',upd));
    document.querySelectorAll('input[name="modeHVAC"]').forEach(el=>el.addEventListener('change',upd));
    document.querySelectorAll('input[name="modeGlass"]').forEach(el=>el.addEventListener('change',upd));
    upd();
  }

  function nextProposalNumber(){ const k='dt:proposalCounter'; const n=parseInt(localStorage.getItem(k)||'1001',10); localStorage.setItem(k, String(n+1)); return n; }

  let jsPDFRef=null; try{ jsPDFRef = (window.jspdf && window.jspdf.jsPDF) || window.jsPDF; }catch(e){}
  document.getElementById("btnGenerate").onclick = function(){ 
    if(!jsPDFRef){ alert("PDF engine unavailable. Load once online to cache, or use Print/Save as PDF."); return; }
    const doc = new jsPDFRef({unit:'pt',format:'a4'});
    const W = doc.internal.pageSize.getWidth(); const H = doc.internal.pageSize.getHeight(); const M=40; let y=48;
    try{ doc.addImage('data:image/png;base64,','PNG',(W-200)/2,y,200,70); y+=84; }catch(e){}
    doc.setFillColor(0,229,234); doc.roundedRect(M,y,W-M*2,36,8,8,'F'); y+=24;
    doc.setTextColor(0,0,0); doc.setFont('helvetica','bold'); doc.setFontSize(14);
    const title='Energy Film ROI Proposal'; doc.text(title, (W - doc.getTextWidth(title))/2, y+6);
    const proposalNo = nextProposalNumber(); const dateStr = new Date().toLocaleDateString();
    doc.setFont('helvetica','normal'); doc.setTextColor(80,80,80); doc.setFontSize(10);
    doc.text('Proposal #: '+proposalNo, M, y+6); doc.text('Date: '+dateStr, W-M-120, y+6); y+=34;

    const spec = FILM_SPECS[document.getElementById('filmChoice').value];
    doc.setFont('helvetica',''); doc.setFontSize(11); doc.setTextColor(40,40,40);
    doc.text('Client: ' + (document.getElementById('clientName').value||''), M, y); 
    doc.text('Site: ' + (document.getElementById('clientAddr').value||''), W/2, y); y+=18;
    doc.text('Film: ' + document.getElementById('filmChoice').value, M, y); 
    doc.text(`VLT ${spec.VLT}%    TSER ${spec.TSER}%    UV >${spec.UV}%    Glare  ${spec.Glare}%`, W/2, y); y+=18;

    const glass = document.getElementById('kpiGlass').textContent;
    const cost = document.getElementById('kpiCost').textContent;
    const save = document.getElementById('kpiSave').textContent;
    const pay  = document.getElementById('kpiPay').textContent;
    const net  = document.getElementById('kpiNet').textContent;

    function row(k,v,x){ doc.setTextColor(110,110,110); doc.text(k, x, y); doc.setTextColor(20,20,20); doc.setFont('helvetica','bold'); doc.text(v, x+180, y); doc.setFont('helvetica','normal'); y+=20; }
    const left=M, right=W/2+10; doc.setFontSize(11);
    row('Estimated Glass Area', glass, left);
    row('Installed Cost', cost, left);
    const yt = y-40; y=yt;
    row('Expected Annual Savings', save, right);
    row('Simple Payback', pay, right); y = Math.max(y, yt+40)+10;
    row('5-Year Net', net, left); y+=6;
    doc.setDrawColor(229,231,235); doc.line(M,y,W-M,y); y+=12;

    doc.setFont('helvetica','bold'); doc.text('Performance Specs', M, y); y+=10; doc.setFont('helvetica','');
    const specs = [['Visible Light Transmission', spec.VLT+' %'], ['Total Solar Energy Rejected (TSER)', spec.TSER+' %'], ['Solar Heat Gain Coefficient (SHGC)', String(spec.SHGC)], ['Shading Coefficient', String(spec.SC)], ['UV Rejected', '>'+spec.UV+' %'], ['Glare Reduction', spec.Glare+' %'], ['Interior Reflectance', spec.VLR_Int+' %'], ['Exterior Reflectance', spec.VLR_Ext+' %'], ['Emissivity', String(spec.Emiss)], ['Winter Median U-Value', String(spec.U)]];
    const col1=M, col2=M+320; specs.forEach(s=>{ doc.setTextColor(110,110,110); doc.text(s[0], col1, y); doc.setTextColor(20,20,20); doc.text(String(s[1]), col2, y); y+=16; });
    y+=6; doc.setDrawColor(229,231,235); doc.line(M,y,W-M,y); y+=14;

    const url = document.getElementById('brandURL').value || '';
    if (url && window.MinQR) { const canvas = window.MinQR(url, 120); const dataURL = canvas.toDataURL('image/png'); try { doc.addImage(dataURL, 'PNG', W-M-120, y-6, 100, 100); } catch(e){} doc.setTextColor(110,110,110); doc.setFontSize(10); doc.text('Scan to schedule', W-M-120, y+100+12); }
    doc.setTextColor(80,80,80); doc.setFontSize(10);
    const footer = 'Dynamic Tintz  Veteran Owned & Operated    469-840-4008    dynamictintzllc@gmail.com    Licensed & Insured    Serving the DFW Metroplex & Surrounding Areas';
    doc.text(footer, M, y); y+=14;

    function imgFmt(dataURL){ return (dataURL && dataURL.startsWith('data:image/png')) ? 'PNG' : 'JPEG'; }

    function finish(before, after){ 
      let imgY = y+6;
      const imgW = (W - M*2 - 20)/2, imgH = 140;
      if(before){ try{ doc.addImage(before, imgFmt(before), M, imgY, imgW, imgH); doc.text('Before', M, imgY+imgH+12); }catch(e){} }
      if(after) { try{ doc.addImage(after, imgFmt(after), M+imgW+20, imgY, imgW, imgH); doc.text('After', M+imgW+20, imgY+imgH+12); }catch(e){} }
      imgY += (imgH + 26);

      doc.setDrawColor(0,0,0); doc.setLineWidth(0.6);
      doc.roundedRect(M, imgY, W-M*2, 90, 6, 6);
      doc.setFont('helvetica','bold'); doc.setFontSize(12); doc.text('Acceptance', M+10, imgY+18);
      doc.setFont('helvetica',''); doc.setFontSize(10); doc.text('By signing, client approves the scope, price, and terms above.', M+10, imgY+34);
      doc.rect(M+10, imgY+44, 10, 10); doc.text('I agree to proceed', M+26, imgY+53);
      doc.setDrawColor(120,120,120);
      doc.line(M+10, imgY+76, M+210, imgY+76); doc.text('Client Name', M+10, imgY+86);
      doc.line(M+230, imgY+76, M+430, imgY+76); doc.text('Signature', M+230, imgY+86);
      doc.line(M+450, imgY+76, W-M-10, imgY+76); doc.text('Date', M+450, imgY+86);

      const sel = document.getElementById('filmChoice').value;
      const sheet = SPEC_IMG[sel];
      if(sheet) { doc.addPage(); doc.setFont('helvetica','bold'); doc.setFontSize(12); doc.text(sel + '  Manufacturer Spec Sheet', M, 60); try{ doc.addImage(sheet,'JPEG', M, 80, W-M*2, H-120); }catch(e){} }
      doc.addPage(); doc.setFont('helvetica','bold'); doc.setFontSize(12); doc.text('Assumptions & Notes', M, 60);
      doc.setFont('helvetica',''); doc.setFontSize(10); 
      const notes = [
        'Performance values are manufacturer lab results on clear glass. Actual results vary by glass type, orientation, shading, climate, and installation conditions.',
        'Savings heuristic scales with film TSER, SHGC reduction, local utility rate, and cooling degree days to approximate relative benefit. For an ASHRAE/DOE-calibrated model, a full audit is recommended.',
        'Proposal valid for 30 days unless otherwise noted.'
      ].join('\\n\\n');
      doc.text(doc.splitTextToSize(notes, W-M*2), M, 80);

      const filename = `Dynamic_Tintz_Proposal_${proposalNo}.pdf`; try { doc.save(filename); } catch(e) { const blob = doc.output('blob'); const url2 = URL.createObjectURL(blob); const a = document.createElement('a'); a.href = url2; a.download = filename; document.body.appendChild(a); a.click(); a.remove(); setTimeout(()=>URL.revokeObjectURL(url2),15000); }
    }

    const bFile = document.getElementById('beforeImg').files[0];
    const aFile = document.getElementById('afterImg').files[0];
    if(bFile || aFile) {
      let b64b=null, b64a=null;
      (function next(){ if(bFile && !b64b){ const r=new FileReader(); r.onload=()=>{ b64b=r.result; next(); }; r.readAsDataURL(bFile); return; } if(aFile && !b64a){ const r2=new FileReader(); r2.onload=()=>{ b64a=r2.result; next(); }; r2.readAsDataURL(aFile); return; } finish(b64b,b64a); })();
    } else {
      finish(null,null);
    }
  };

  document.getElementById("btnPrint").onclick = ()=>window.print();
  bind(); compute();
})();
